import React from "react";
import { View, Text } from "react-native";
import MenuHeader from "../layouts/MenuHeader";
import Banner from "../layouts/Banner";
import PageHome from "./PageHome";
import PageLogin from "./PageLogin";
import { createNativeStackNavigator } from "@react-navigation/native-stack";

const StackHome = createNativeStackNavigator();
export default ({ navigation, titulo }) => {
  return (
    <StackHome.Navigator initialRouteName="PageHome">
      <StackHome.Screen component={PageHome} name="PageHome" />
      <StackHome.Screen component={PageLogin} name="PageLogin" />
    </StackHome.Navigator>
  );
};
